import React from "react";

class UserClass extends React.Component{

  constructor(props)
  {
    super(props);
  }

  render(){
      const  {name, location, contact} = this.props;

    return(
        <div className="user-card">
            <h2>name:{name}</h2>
            <h3>location:{location}</h3>
            <h4>contact:{contact}</h4>
        </div>
      );
  }
}

export default UserClass;
